import React from "react";
import Post from "./Post/Post";
import {Grid, CircularProgress} from "@mui/material";
import {useSelector} from "react-redux";
const Posts = () => {
    const posts = useSelector((state) => state.posts)
    console.log(posts);
    return(
        <>
            <h2>POSTS</h2>
            <Post/>
            <Post/>
        </>
    )
}
export default Posts;
